856	217	0	0	0	2015-11-25 12:22:05.922899	<p>The objective of this course is to take you to a whirlwind tour of the Raspberry Pi, and introduce you to everything that is great about it.<br/><br/>Structured as a project, you will become familiar with the various components that make up the web development stack: the operating system, the hardware (including the GPIOs), the application server, web server, database server, and the Python programming language.<br/><br/>You will also become familiar with Cloud services that you will integrate into your Raspberry Pi-powered web application.<br/><br/>You application will take sensor data and make them available to the user via a web interface that is constructed based on jQuery and HTML5.<br/><br/>You will need a Raspberry Pi, a DHT22 sensor, a button, an LED, a few resistors and a breadboard. If you wish to setup wireless networking on your Raspberry Pi, you will also need a USB Wifi dongle.<br/><br/>To make the most from this course, you should be familiar with basic programming and be comfortable with the command line.</p>	\N	\N	\N	0	2016-04-30 15:16:52	213	0	0	Raspberry Pi: Full Stack	0	619	t	download.jpg	A whirlwind tour of full-stack web application development on the Raspberry Pi	<div><ul><li>Over 58 lectures and 7 hours of content!</li><li>Setup the minimal Raspbian operating system to the RPi.</li><li>Install the a Python virtual environment.</li><li>Install and use Flask, a Python-based web micro-framework</li><li>Install and use uWSGI as the application server for Flask</li><li>Install and use Nginx light-weight web server</li><li>Use the RPi GPIOs as digital input and outputs</li><li>Use a DHT22 humidity and temperature sensor</li><li>Install and use the SQLite database</li></ul></div>	<div><ul><li>Some experience in programming is useful.</li><li>Python, Javascript (jQuery) and HTML is used throughout the course and some familiarity with basic programming concepts is expected.</li><li>Ability to wire electronic