843	209	0	0	0	2015-11-25 11:49:12.925716	<p>This course is designed to teach you the core skills that make up the entire Product Management process. From ideation to market research to wireframing to prototyping to user stories to Product Management leadership. I designed course to be easily understood by people who are new to Product Management.<br/><br/>In addition to mastering the core skills, you''ll actively apply it by learning popular Product Management tools like Popplet, Axure, Pivotal Tracker. You''ll get a chance to build out one of your own product ideas through 10 step-by-step exercises complete with working files and sample templates. At the end of the course, you''ll have a product spec with a feature backlog, wireframes, and an interactive prototype.<br/><br/>Ever wonder how organizations like Apple, NASA, and Ticketmaster design their products? You will after taking this course. You''ll be getting a condensed knowledge transfer from a 8 year Product Management veteran who has led teams at those prestigious organizations and has launched over a dozen products used by millions of users daily. You''ll get a behind-the-scenes look at several real life examples of wildly successful products and learn the secret sauce.</p>	\N	\N	\N	0	2016-04-30 15:21:22	207	24	0	The Complete Product Management Course	0	619	t	download-1.jpg	Learn how to become a rockstar Product Manager with this comprehensive course filled with real life examples	<div><ul><li>Over 91 lectures and 6 hours of content!</li><li>Learn core skills that make up the entire Product Management process. From ideation to market research to wireframing to prototyping to user stories to leadership.</li><li>Discover the secret method behind how Apple creates laser-focused products</li><li>Build your product portfolio with 10 step-by-step exercises that will take your product idea from concept to spec</li><li>Use popular Product Management tools like Popplet, Pivotal Tracker, and Axure</li><li>Get a behi