619	userpass	\N	USER_PASSWORD	2013-07-29 15:39:48.906	Dr. Scott Brown	productdemo.user+user2@gmail.com	1	1	0	1375111757582	614	2016-04-18 12:43:05.263	$2a$10$9NInpm0WW3wXAun.c1K5g.SuAecBmyVTabYGEGMGw/kn08tvbsCFS	\N	\N	\N	24	0	t	281	135.40000000000001	6.9000000000000004	0	0	0	dr-scott-brown	13275922_0842_2-1.jpg	619.f90d16b8f126e8806e3bd9bf5c7c4fba.jpg	0	2016-04-18 12:43:05.263	Major State University Finance Professor, Investments Expert	\N	Dr. Scott Brown and “Intelligent Investing” — helping you get the most out of your hard earned investment capital.\r\n\r\nAs an investor, I have spent over 35 years reading anecdotal accounts of the greatest investors and traders in history. My net worth has grown dramatically by applying the distilled wisdom of past giants.\r\n\r\nMy Curriculum Vitae:\r\n\r\nInvestment Writing and Speaking:\r\n\r\nI am an international speaker on investments. In 2010 I gave a series of lectures onboard Brilliance of the Seas as a guest speaker on their Mediterranean cruise. Financial topics are normally forbidden for cruise speakers. But with me they make an exception because of my financial pedigree.\r\n\r\nOn day 6 the topic I discussed was “Free and Clear: Secrets of Safely Investing in Real Estate!“ The day 7 topic was “Investment Style and Category: How the Stock Market Really Works!” Then on day 8 I spoke about “The 20% Solution: How to Survive and Thrive Financially in any Market!” The final talk on day 11 was “Value Investing for Dummies: When Dumb Money is Smart!”\r\n\r\nGina Verteouris is the Cruise Programs Administrator of the Brilliance of the Seas of Royal Caribbean Cruise Lines. Regarding my onboard teachings she writes on June 19th, “You have really gone above and beyond expectations with your lectures and we have received many positive comments from our Guests.”\r\n\r\nI sponsored and organized an investing conference at Caesars Palace in Las Vegas in 2011 under my Wallet Doctor brand. This intimate conference was attended by 14 